pragma solidity ^0.4.24;
import "../node_modules/openzeppelin-solidity/contracts/token/ERC20/ERC20Mintable.sol";
import "../node_modules/openzeppelin-solidity/contracts/token/ERC20/ERC20Burnable.sol";
import "../node_modules/openzeppelin-solidity/contracts/token/ERC20/ERC20Pausable.sol";
contract Buyer is ERC20Pausable, ERC20Mintable, ERC20Burnable {
    string public constant name = "Buyer Chain";
    string public constant symbol = "BUC";
    uint8 public constant decimals = 2;
    uint256 public totalSupply = 1000000;
    constructor () public {
     }
     struct EscrowW{
         uint256 escrowId;
         uint payment;
         address seller;
         address buyer;
         bool complain;
         bool accept;
     }
     struct Item{
        uint256 itemId;
        string title;
        uint price;
        address seller;
        bool ordered;
        bool fulfilled;
        bool completed;
        string complain;
     }
    mapping(uint256 => EscrowW) public EscrowWallet;     
    mapping(uint256 => Item) public ItemsToSell;


    function listItems(
        uint256 _itemId,
        string memory _title,
        uint _price,
        address,
        bool,
        bool,
        bool,
        string memory
    ) public {
        ItemsToSell[_itemId] = Item(
            _itemId,
            _title,
            _price,
            msg.sender,
            false,
            false,
            false,
            ""
        );
    }
    function fulfillOrder(uint256 _itemId) public {
        require(ItemsToSell[_itemId].seller == msg.sender && ItemsToSell[_itemId].ordered==true);
        ItemsToSell[_itemId].fulfilled = true;
    }

    function orderItems(
        uint256 _itemId,
        uint256 _escrowId,
        uint _payment,
        address _seller,
        address,
        bool _complain,
        bool _accept
    ) public {
        require(ItemsToSell[_itemId].seller != msg.sender);
        EscrowWallet[_escrowId] = EscrowW(
            _escrowId,
            _payment,
            _seller,
            msg.sender,
            false,
            false        
        );
    }

}
